import Card from './card'
import Input from './input';

  
class ToDo extends Component {
    
    state={ };

    render() {
        return (
           <div className="card m-5">
                    <div className="card-body">
                        <div className="row">
                            <div className="m-5">
                                <input type="text" className="form-control"></input>
                            </div>
                     </div>
               </div>
           </div>
        );
    }
}

export default ToDo;
